text = '%{\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cantiquated notion of a university that acknowledged that, as John Henry Newman put it more than 150 years ago, “the general principles of any study you may learn by books at home; but the detail, the color, the tone, the air, the life which makes it live in us, you must catch all these from those in whom it lives already\n\nJune 4, 2017\n\u001c11\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhile many analogize finance to physics, the better analogy is to biology. There is a branch that, like molecular biology, precisely focuses on the most essential building blocks of life. That branch is called “asset pricing.” And there is a branch called “corporate finance” that is akin to sociobiology, interested in all the contingencies and messiness of the world that we actually observe. The book follows a conceptual arc that is divided roughly between those two branches.\n\nJune 4, 2017\n\u001c15\n\u0011\n\u0011\n\n\nThe Wheel of Fortune\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cas important as chance is, we just can’t seem to escape our own patterns. As Byrne repeatedly chants throughout “Once in a Lifetime,” everything is the “same as it ever was.”\n\nJune 4, 2017\n\u001c22\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cfinance is, at its core, a way to understand the role of risk and randomness in our lives and a way to use the dominance of patterns to our advantage.\n\nJune 4, 2017\n\u001c22\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnd for Peirce, everything came down to . . . insurance. Throughout his life, he returned to insurance, declaring in 1869 that “each of us is an insurance company.” How and why did such a broad and deep thinker keep returning to what seems to many of us like the most mundane and uninteresting subject—insurance? Because insurance is anything but mundane and\n\nJune 4, 2017\n\u001c23\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cuninteresting. For Peirce, it became a central frame for understanding one’s life\n\nJune 4, 2017\n\u001c23\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPeirce, by contrast, embraced chance and randomness—and that led him to . . . insurance! Indeed, Peirce’s understanding of the world—that randomness is everywhere but predictable in aggregate—is the foundation of insurance and modern finance. The tools needed to navigate a world filled with uncertainty is what finance endeavors to provide. Risk is everywhere, it is undeniable, and it shouldn’t be ignored or surrendered to—it should be managed. And insurance is the primary way we manage the risks in our lives.\n\nJune 4, 2017\n\u001c30\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cinvesting skill is best understood as his ability to source financing very cheaply through insurance companies. He understood how interesting insurance can be\n\nJune 4, 2017\n\u001c31\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe Rhodian Law provides that if in order to lighten a ship, merchandise is thrown overboard, that which has been given for all, should be replaced by the contribution of all.” If a captain has to throw some goods overboard to save other goods, it’s only fair that the owners of the goods that have been saved compensate the owners of the goods that were jettisoned. Even today, ships will declare general average, under the York-Antwerp Rules, and impose these costs on cargo holders. The practice of general average is a pooling of risk, which is the essence of insurance. Insurance binds people together by mutualizing risk: we’re all in this together. The pooling achieved by general average happens forcibly as a matter of maritime law rather than a voluntary insurance contract.\n\nJune 4, 2017\n\u001c32\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwhat organization is best suited to pool risk and counter the effects of moral hazard and adverse selection? It should be one where membership isn’t a choice, so that adverse selection isn’t operating, and one where you can closely monitor each other’s behavior to make sure moral hazard doesn’t work against you. Well, of course, that’s the family. You don’t get to choose your family, so that takes care of adverse selection. And families provide the intimacy for making sure behavior isn’t changing\n\nJune 5, 2017\n\u001c38\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1Qgj4dV0OOCQ2n9nskn8eR-hOAjuG_rpmRUEYhkI","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1Hvs2_wTZB46eckWauQXPKhPo43TRYRziLlZX3ic","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"se