Nf8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunk = [{"ty":"is","ibi":4188,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cto take advantage of the insurance. Indeed, families have been the most important source of insurance for millennia. Various studies have confirmed that insurance of all kinds is provided within a family and extended families, particularly in developing countries. As one clear example of this, consider what happened to the rate of “household formation” after the financial crisis. We saw a collapse in the creation of new households as children moved back in with their parents in the wake of the financial recession. As Robert Frost said, “Home is the place where, when you have to go there, they have to take you in.”\n\nJune 5, 2017\n\u001c38\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhy did Peirce, the remarkable Renaissance man who was able to embrace both chance and the regularities of the normal distribution, conclude that we should see ourselves as insurance companies? For Peirce, if “chance itself pours in at every avenue of sense,” then it naturally followed that “all human affairs rest upon probabilities, and the same thing is true everywhere.” The first lesson from Peirce comes simply from the embrace of randomness.\n\nJune 5, 2017\n\u001c39\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOnce you embrace randomness, you are left with the task of making sense of the world and seeking out the patterns that can guide your behavior. That leads us to probabilities as the only way to really understand the world—nothing is entirely certain and we should approach the world probabilistically. If we want to understand how probable things are and how the world works, the only way to figure out these probabilities is through experience, just as with an insurance company. The more experience an insurance company has with a population, the better their understanding of probabilities and the more successful their business.\n\nJune 5, 2017\n\u001c40\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThat’s why, in effect, we’re all insurance companies—experience is the critical method for understanding how to thrive. Peirce’s emphasis on insurance was a natural extension of his philosophy of pragmatism. Pragmatism is the opposite of navel-gazing; in pragmatism, truths are only valuable to the degree they can inform actions, and actions are only valuable if they confirm a truth. Peirce often talks about experience with the statistical term “sampling.” Only by sampling what the universe has to offer can we learn anything of value. We should experience as much as possible—just as insurance companies must—in order to make\n\nJune 5, 2017\n\u001c40\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cgood decisions and understand the world with the right probabilities.\n\nJune 5, 2017\n\u001c40\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDeath makes the number of our risks, of our inferences, finite, and so makes their mean result uncertain. The very idea of probability and of reasoning rests on the assumption that this number is indefinitely great. We are thus landed in the same difficulty as before, and I can see but one solution of it . . . logicality inexorably requires that our interests shall not be limited. They must not stop at our own fate, but must embrace the whole community. This community, again, must not be limited, but must extend to all races of beings with whom we can come into immediate or mediate intellectual relation. It must reach, however vaguely\n\nJune 5, 2017\n\u001c40\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbeyond this geological epoch, beyond all bounds . . . Logic is rooted in the social principle. To be logical, men should not be selfish. If our own experiences are inherently limited, understanding the world requires incorporating the experiences and welfare of others. Reacting against the idea of social Darwinism, Peirce instead thought that the logic of insurance and sampling inexorably led to “that famous trio of Charity, Faith and Hope, which, in the estimation of St. Paul, are the finest and greatest of spiritual gifts.” We must embrace others to understand the world—the imperative of experience gathering demands it. For Peirce, insurance teaches us that experience and empathy are the key methods for dealing with the chaos of the world.\n\nJune 5, 2017\n\u001c41\n\u0011\n\u0011"},{"ty":"te","id":"i.11","spi":4197},{"ty":"te","id":"i.12","spi":4852},{"ty":"te","id":"i.13","spi":5335},{"ty":"te","id":"i.14","spi":6001},{"ty":"te","id":"i.15","spi":6665},{"ty":"te","id":"i.16","spi":6768},{"ty":"te","id":"i.17","spi":7444},{"ty":"as","st":"paragraph","si":4188,"ei":4188,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":4189,"ei":4189,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":4190,"ei":4190,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":4192,"ei":4192,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":4194,"ei":4194,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":4196,"ei":4196,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":