,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":7447,"ei":8199,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":8200,"ei":8213,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunk = [{"ty":"is","ibi":8220,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFor Peirce, insurance became the central metaphor for explaining that and describing how to handle it—through experience, pragmatism, and empathy. For Stevens, a man who spent his life negotiating insurance claims rather than dedicating himself uniquely to poetry, imagination was the central tool for managing the omnipresence of chaos and for seeking and seeing the hidden order of things amid the chaos. It is no wonder that Stevens concluded that “poetry and surety claims aren’t as unlikely a combination as they may seem.”\n\nJune 5, 2017\n\u001c43\n\u0011\n\u0011\n\n\nRisky Business\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cInsurance, as we saw, is a powerful tool for managing the risks of mortality, longevity, or natural disasters. But what about the risks we face in the labor market or marriage market? There aren’t insurance policies available for those risks. Fortunately, finance has adapted the logic of insurance to create the two most important risk management tools available to us—options and diversification.\n\nJune 5, 2017\n\u001c47\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnd that is just what she did—having accumulated multiple suitors, she exercised her option for Lord Chiltern when she was ready to marry. In financial parlance, this is tantamount to creating a portfolio of options and then choosing to invest in one asset at the opportune time. The portfolio of options allows you to wait until you are ready to invest and to see how these assets are evolving—far preferable to committing to one asset prematurely or waiting in the hopes that the “right” asset will come along eventually\n\nJune 5, 2017\n\u001c51\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPeople in finance love options for the freedom and opportunity they represent. And they frame much of their life in analogous terms. By pursuing education, for example, they increase “option value” because more degrees and networks mean that more choices will be available to them.\n\nJune 5, 2017\n\u001c51\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis transaction is the essence of an options transaction—relatively small premia are paid to secure the rights to enter into transactions rather than obligating someone to do something, thereby enabling them to access resources they might need but don’t know if they will need. A stock option, for example, allows you the right to buy a share at a predetermined price at some point in the future for a relatively small price today.\n\nJune 5, 2017\n\u001c52\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c(calls) and the right to sell (puts) on the Dutch East India Company, de la Vega claimed that these instruments are both “sails for a happy voyage during a beneficent conjuncture and an anchor of security in a storm.” By purchasing a right as opposed to buying the asset itself, options create an asymmetry that enables speculation (“a happy voyage during a beneficent conjuncture”) and risk management (“an anchor of security in a storm”). Because an option is a right and not an obligation, you don’t have to purchase assets if they decline, but you can still enjoy the possibility of price increases—this characteristic makes it a powerful speculative tool.\n\nJune 5, 2017\n\u001c53\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn part, people in finance love options because of the nature of this asymmetric payoff. Losses are contained and gains are unlimited. And experiences that create optionality—educational experiences, for example—are valued precisely because of the asymmetric nature of the payoffs.\n\nJune 5, 2017\n\u001c53\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPurchasing options allows us to wish for outcomes and allows us to imagine what is possible and what might come true. This link between options and the desire to explore what is possible is precisely why Ralph Waldo Emerson called America “optative”—options are for people who want to imagine the outcomes that they desire.\n\nJune 5, 2017\n\u001c54\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe most distinctive aspect of options is how their asymmetric nature makes them particularly valuable when environments become more risky. Because you have little to lose and much to gain, events that make outcomes more extreme are welcome. In other words, options, because they are a form of insurance, are more valuable when life becomes even more uncertain. By implication, if you hold an option, you will be encouraged to undertake riskier adventures. So, the real payoff from having options is the risk-taking that it enables. This is particularly evident when you come to realize suddenly that you hold an option.\n\nJune 5, 2017\n\u001c54\n\u0011\n\u0011"},{"