_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":11914,"ei":11927,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":11946,"ei":12567,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":12568,"ei":12581,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunk = [{"ty":"is","ibi":12588,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAcquiring options can help you assess a set of outcomes beyond your current capabilities, allow you to take more risks than you would otherwise, and simultaneously protect you when you stumble.\n\nJune 5, 2017\n\u001c55\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI am no longer surprised to see students who end up remaining in companies—usually consulting or investment banking firms—that were initially intended as way stations that would create more optionality on the path to their actual entrepreneurial, social, or political goals. They often end up saying to themselves, “Why not stay another year and create more options for down the road?” The tool that was supposed to lead to more risk-taking ends up preventing it. Any commitment necessarily must overcome the loss of option value that choices close off. So, commitments of various kinds become difficult given the extra burden they bear. It is not uncommon to hear people in finance talk about marriage as the death of optionality. Implicitly, the act of marriage is characterized as the loss of something—future choices—rather than the beginning of something. As a result, a focus on the creation and preservation of choices can ironically lead to an inability to make choices\n\nJune 5, 2017\n\u001c55\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csometimes, the prospect of multiple outcomes is so tantalizing that we resist actually making a decision, preferring to live in a world of possibilities. This is what Bartleby does—preferring potentiality over reality, preferring optionality over real decisions\n\nJune 5, 2017\n\u001c57\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis logic of diversification is the cornerstone of portfolio theory and represents the only true “free lunch” in finance. It’s also a logic with a long history as a risk management strategy. The earliest examples, like those of insurance, date back to early shipping where cargo would be divided among ships and routes to mitigate the risks of a loss.\n\nJune 5, 2017\n\u001c59\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe key insight from finance is that diversification of the type recommended in these religious texts not only reduces risks but can actually preserve returns. What could be better than similar returns with less risk? By investing in assets that perform differently, we can benefit from the imperfect relationship between assets. In fact, the best kinds of assets are those that behave very differently from the assets you already own—such assets, when included in your portfolio, reduce risk and can preserve returns. And assets that perform much like what we already own are of limited use for diversification purposes.\n\nJune 6, 2017\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe finance take on this is that diversifying\n\nJune 6, 2017\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cour experiences and relationships is precisely what we should be doing—relationships don’t crowd each other out but they enrich each other. Being a good friend and colleague doesn’t diminish your efforts as a parent but may well benefit those efforts.\n\nJune 6, 2017\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn fact, the relationships that are most enriching are ones that broaden our perspective beyond our usual experience—those relationships are, in finance terms, “imperfectly correlated assets,” precisely the types of assets that most enhance the portfolios of our lives. Similarly, filling our lives with only those people who think like we do and who experience the same world that we inhabit is not nearly as powerful. Just as Keynes found it hard to intuit diversification, the logic of a diversified portfolio of relationships runs counter to many of our instincts. Homophily, or the desire to surround ourselves with like-minded people, is a common social instinct—and one that finance warns against. Yes, it’s easier to be around like-minded types, but finance recommends the hard work of exposing yourself to differences, not shielding yourself from them\n\nJune 6, 2017\n\u001c62\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSo, here’s what that model boils down to: assets that fluctuate very much along with your portfolio are “high-beta” assets that are not highly valued because of their limited diversification value. In fact, they make your exposure to the market even more pronounced—when the market goes down, these stocks go down a lot. The low values of these high-beta assets are the result of the high returns you expect from those assets—since they don’t provide much diversification value, they’d better be associated with high returns. And here’s the most elusive part of that finance logic—if you need high returns from assets, that can only be accomplished by giving them lower prices today. Lower prices for a given stream of cash flows create the higher returns you need to compensate you for the risk presented by these high-beta stocks.\n\nJune 6, 2017\n\u001c63\n\u0011\n\u0011"},{"ty":"te","id":"i.27","spi":12597},{"ty":"te","id":"i.28","spi":12824},{"ty":"te","id":"i.29","spi":13835},{"ty":"te","id":"i.30","spi":14130},{"ty":"te","id":"i.31","spi":14516},{"ty":"te","id":"i.32","spi":15171},{"ty":"te","id":"i.33","spi":15250},{"ty":"te","id":"i.34","spi":15535},{"ty":"te","id":"i.35","spi":16429},{"ty":"as","st":"paragraph","si":12588,"ei":12588,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":12589,"ei":12589,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":12590,"ei":12590,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":12592,"ei":12592,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":12594,"ei":12594,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":12596,"ei":12596,"sm":{"cell_pr_i":false,"cel