alse,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":16432,"ei":17265,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":17266,"ei":17279,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunk = [{"ty":"is","ibi":17286,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLow-beta” assets, in contrast, move with your portfolio but just not as much, so they don’t need to generate as high returns and, therefore, have higher prices. As you may already surmise, betas are simply shorthand for the correlation of an asset with your portfolio. At the other extreme, “negative-beta” assets move in the opposite direction of your portfolio—when your whole portfolio does well, these negative-beta assets do poorly, and when your whole portfolio tanks, these stocks do very well.\n\nJune 6, 2017\n\u001c64\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cvery valuable. Their high value comes from the low expected returns you require of them; that is, since they provide such effective insurance, they don’t need to give you explicit returns. In fact, such assets can be associated with negative expected returns precisely because they do such a good job of performing well when the rest of your portfolio is a disaster. It all goes back to the principles of insurance. Assets that provide insurance—by paying off when the rest of your assets do poorly—are very valuable, and you will pay dearly for them. And assets that exacerbate the risks you face in the rest of your portfolio are not highly valued and need to earn a high return to compensate you for all that additional risk exposure.\n\nJune 6, 2017\n\u001c64\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSo, who are the high-beta, low-beta, and negative-beta assets in your life? The high-beta assets in your life are likely your LinkedIn network or professional acquaintances. These relationships are largely instrumental; in other words, these individuals are likely to show up when you do well and disappear when things go poorly. Accordingly, they should be given low values—it’s not that they can’t be a source of great benefits; it’s just that they compound the risks you face and don’t provide much insurance. When you’re down on your knees, these assets provide no relief. Low-beta assets are considerably more valuable—they are the steady friends who are there for you no matter what happens to you. In fact, this classification of friendships closely mirrors the taxonomy of friendships provided by Aristotle in Nicomachean Ethics . The lowest form of friendship, for Aristotle, is the high-beta, transactional friendship where\n\nJune 6, 2017\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cindividuals “love each other for their utility” and “do not love each other for themselves but in virtue of some good which they get from each other.” These are friendships that are thin and fragile as “if one party is no longer pleasant or useful the other ceases to love him.” When you’re succeeding, these high-beta friends surface, but they disappear when you stumble because you become less valuable to them. The much higher notion of friendship is the low-beta friendship where good individuals wish each other well without qualification based on the goodness that these friends feel toward them.\n\nJune 6, 2017\n\u001c65\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut Aristotle reserves his highest praise for the love that is unconditional—the negative-beta assets in your life. When you stumble the hardest, these people are there for you the most—and when you fly too high, they manage to pull you back down to earth. Noting that “most people seem . . . to wish to be loved rather than love,” Aristotle contrasts that typical sentiment with mothers who “take delight in loving” and “they themselves love their children even if these owing to their ignorance give them nothing of a mother’s due.” That sounds just like the negative returns we are willing to live with for negative-beta assets. When we love our negative-beta assets unconditionally—we give and give and give and expect nothing in return—that’s negative expected\n\nCan I model this in your FB friends? Low beta are the consistent posters, high beta are the ones who wish you hbd only, and low beta post every once in a while..?\n\nJune 6, 2017\n\u001c66\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn finance, we are trying to figure out how to invest our assets and manage toward the best risk-return tradeoff. In life, we are trying to figure out how to allocate our time and energies across many people. It also matches because the underlying logic of insurance is present in both settings. For me, this parallel prompted several questions: Am I providing insurance to my loved ones and friends? Am I there when they need me the most? Am I dedicating too much time to the high-beta assets in my portfolio rather than realizing that they are relatively low-value relationships? And am I valuing the negative-beta assets in my life appropriately?\n\nJune 6, 2017\n\u001c66\n\u0011\n\u0011"},{"ty":"te","id":"i.36","spi":17295},{"ty":"te","i