t_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":20974,"ei":21137,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#424242","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":21138,"ei":21151,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":21170,"ei":21820,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":21821,"ei":21834,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunk = [{"ty":"is","ibi":21841,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cUltimately, she realizes that Darcy is not working against her sisters’ interests but is actually a reliable ally. Her visit to Darcy’s estate is a critical turning point as she learns of his generous character and steadfast nature from his staff—he is not the arrogant, opportunistic high-beta asset she was wary of. With risks investigated and returns well established, Lizzy gets a second bite at the apple as Darcy presents the option yet again, and now Lizzy doesn’t hesitate. Instead of thinking of how much the loss of optionality would cost her, she “hits the bid.” She seems to have understood that risk management is not a goal in and of itself—but rather a set of strategies to ensure that one can take the big bets one needs to take to truly create value.\n\nJune 6, 2017\n\u001c67\n\u0011\n\u0011\n\n\nOn Value\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c. Our talents are more personal than a simple calculation of net worth. They are the gifts that make us special and the abilities that we develop over time. If there is a link between money and talents for our modern sensibilities, it is that money and fortune may accrue from the exercise of our talents.\n\nJune 6, 2017\n\u001c68\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhile I wrestle with some dimensions of the parable, the main lessons seem clear—everyone has been endowed with talents and gifts; they are distributed unequally; they are incredibly valuable; and, most importantly, they should be exercised\n\nJune 6, 2017\n\u001c70\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cto their fullest extent. We are the stewards of those gifts and must make the most of them. At some point, we’ll all be held accountable for what we do with our gifts, and living in fear and depriving yourself and the world of your gifts is sinful. There also seems to be a close connection to our earlier discussion of risk: one can try to insure against and manage risk to some extent, but, ultimately, life entails risks\n\nJune 6, 2017\n\u001c70\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn short, finance has a simple recipe for value creation—1) surpass the expected returns of your capital providers; 2) surpass those expectations for as long as you can; and 3) grow, so you can keep generating returns that are higher than your cost of capital.\n\nJune 6, 2017\n\u001c72\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThat logic of stewardship and obligation is central to finance—we are overseeing the capital that others have entrusted to us\n\nIf I invest my time and energy I need u to return more than cost of capital, durably, and reinvest your growth. AJ - people don\u0027t get invested in. If you invest in and trust in people, they will walk through walls for you.\n\nJune 6, 2017\n\u001c72\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe founder of Methodism, John Wesley, clearly understood the link between the parable of the talents and value creation back in the 1700s. He explicitly linked the parable to finance in a sermon titled “The Use of Money.” The latter two parts of the sermon are summarized as “Do not throw the precious talent into the sea” and “Having, First, gained all you can, and, Secondly saved all you can, Then give all you can.” This quote is in fact the origin of the more popular framing of Wesley’s logic: “Do all the good you can. By all the means you can. In all the ways you can. In all the places you can. At all the times you can. To all the people you can. As long as ever you can.” It is difficult to summarize the financial logic of value creation any better.\n\nJune 6, 2017\n\u001c73\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFinance’s starting point in valuation is that previous accomplishments and what you have to day bear little relationship to real value. Finance is completely and ruthlessly forward-looking. The only source of value today is the future. The first step of valuation is to look forward and project what a company or investment will produce in the future\n\nJune 6, 2017\n\u001c75\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIf you look at any valuation model used in finance, it has that basic structure. Ignore the past and present. Look forward to the future and project economic returns. Translate those back to today’s value using a “weighted average cost of capital”—a blend of the returns expected by your debt and equity financing. That translation gives you what something is worth today—and if it’s more than what you have to pay for the asset, you have a good deal. Valuing an investment in education has the same structure—project forward the extra wages you will earn because of that education, translate those incremental wages back to today, and compare them to the tuition. If the translated future values are greater than the tuition, you have a good investment.\n\nJune 6, 2017\n\u001c75\n\u0011\n\u0011"},{"ty":"te","id":"i.42","spi":21850},{"ty":"te","id":"i.43","spi":22662},{"ty":"te","id":"i.44","spi":23001},{"ty":"te","id":"i.45","spi":23275},{"ty":"te","id":"i.46","spi":23732},{"ty":"te","id":"i.47","spi":24026},{"ty":"te","id":"i.48","spi":24409},{"ty":"te","id":"i.49","spi":25205},{"ty":"te","id":"i.50","spi":25589},{"ty":"as","st":"paragraph","si":21841,"ei":21841,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":21842,"ei":21842,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":21843,"ei":21843,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":21845,"ei":21845,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":21847,"ei":21847,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":21849,"ei":21849,"sm":{"cell_pr_i":false,"cell_bl":{},"cell_pt_i":false,"cell_bb_i":false,"cell_pt":0.0,"cell_bt":{},"cell_pb":0.0,"cell_pl_i":false,"cell_b