_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunk = [{"ty":"is","ibi":26368,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFinance’s approach to valuation is as harsh as the logic of value creation. Whatever you’ve done in the past doesn’t matter and the only thing that matters is the future—and the longer you make me wait for my returns in that future, the greater the punishment via discounting. All value accrues from the future. In fact, any finance practitioner knows that standard valuation models result in the vast majority of value being attributed to so-called terminal values. The value of companies like Facebook, LinkedIn, and Twitter hinges on whatever assumptions we make about what they will do far off in the future—and these assumptions are captured in what people call terminal values. In short, though we project what they’ll do in the next several years, the majority of their value is going to come from whatever we think they’ll do well down the road.\n\nJune 6, 2017\n\u001c76\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFirst, ruthlessly look forward and ignore the past and present in deciding what value is and what actions to undertake. Your previous accomplishments and missed opportunities mean nothing when looking at yourself today. Second, this emphasis on the future means that all estimates of value and decision making are acts of imagination and fundamentally conjectural. Imagining alternative futures is critical for making good decisions, just as it is for valuing investments. Finally, most value arises from terminal values (reflecting returns into perpetuity) and not returns in the short run. We are in a long game, and most enduring value arises from what we leave behind—our legacies—and not what we enjoy while we’re here. I recall my father often telling me something that I now tell my daughters (my terminal values)—“the world belongs to the young.” This is an adaptation of a Mao Zedong quote, but the sentiment permeates many traditions and it is an encapsulation of the logic of finance. We are in service of future generations, for it is their world much more than ours.\n\nJune 7, 2017\n\u001c77\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLevet was a poor man to whom Johnson gave shelter and Levet became a caretaker of sorts for those around him. While in many ways a completely unremarkable man, Levet was worthy of the highest praise from Johnson: “obscurely wise, and coarsely kind,” an individual who, through the care and affection he gave those around him, demonstrated “the power of art without the show.” Why did Levet deserve such praise? Johnson invokes the parable when he concludes: His virtues walk’d their narrow round, Nor made a pause, nor left a void; And sure th’ Eternal Master found The single talent well employ’d. Johnson, a man blessed with innumerable talents, took inspiration from a man with little material wealth or natural ability, but with the sole\n\nJune 7, 2017\n\u001c79\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ctalent of providing care and affection to those around him. For Johnson, the parable is not a recipe for worshipping the “great men and women” of the world who have been given much, but rather a lesson in humility and a reason to appreciate the contributions of those who provide so much despite not being endowed as richly as he was.\n\nJune 7, 2017\n\u001c79\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbeta is a measure of how a stock moves with the market. And that co-movement with the market is the risk that investors can’t diversify away and must bear, and therefore demand compensation for. So money managers who get paid for providing returns that are just associated with bearing that risk are doing nothing of value. According to the logic of valuation, they are not creating value. Yet, they are still being compensated handsomely—they are being paid for beta. Returning to our previous example, they are just meeting expectations, yet they think they’re creating value. In contrast to this freeloading logic, “alpha” represents value creation—these are the returns above and beyond expected returns. In short, alpha generators have reached finance nirvana. You are truly generating value, beyond any returns expected for risks borne, when you generate alpha. The mistake people in finance make all too often is reflected in their appreciation of the more challenging parts of the parable of the talents. They attribute much of their success and returns simply to alpha generation and they pride themselves on it. In reality, finance teaches us that it is very difficult to know the extent to which our efforts are responsible for generating alpha.\n\nJune 7, 2017\n\u001c81\n\u0011\n\u0011"},{"ty":"te","id":"i.51","spi":26377},{"ty":"te","id":"i.52","spi":27264},{"ty":"te","id":"i.53","spi":28377},{"ty":"te","id":"i.54","spi":29152},{"ty":"te","id":"i.55","spi":29520},{"ty":"as","st":"paragraph","si":26368,"ei":26368,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":26369,"ei":26369,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i"