t+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunk = [{"ty":"is","ibi":30801,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFirst, there is the nature of randomness that will make any measure of success unreliable. Sec ond, there is the inability to identify cleanly which risks have been undertaken, creating ambiguity over what expected returns should have been. Finally, there is now plenty of evidence that indicates that few money managers consistently beat the market, after consideration of their fees\n\nJune 7, 2017\n\u001c83\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cmachismo that heralds market outcomes as clear indicators of effort and ability should be tempered. And the heroism associated with the supposedly meritocratic nature of finance is unjustified. If anything, there is no endeavor where it is easier to recharacterize luck as skill and bad performance as exceptional performance than within the field of finance.\n\nJune 7, 2017\n\u001c83\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTo make from your wrongs to your rights, finance.” In short, living up to and settling one’s obligations is the road to salvation.\n\nJune 7, 2017\n\u001c85\n\u0011\n\u0011\n\n\nBecoming a Producer\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJune 8, 2017\n\u001c92\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccapital markets begin to look like a daisy chain of principal-agent contracts, each with significant problems and conflicts\n\nJune 8, 2017\n\u001c94\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSometimes the reversal of principal and agent roles happens not so innocently or consciously. Many of us parent with the best of intentions but are guilty of projecting our unrealized ambitions or hopes onto our children. In those situations, we pretend to be agents of our children’s dreams and potential, but we are actually the principals trying to force our agents/children into a mold\n\nWhat does this mean for your game. I can\u0027t get points when my agents do well. It\u0027s principals who have to get points (them) if I give relevant investment / interaction\n\nJune 9, 2017\n\u001c100\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe lens of the principal-agent problem can’t tell us what the right thing to do is, but it can make us aware of how muddled the situation can be—and how the stories of work and family life that we often tell ourselves are narratives shaped to our own ends. Being aware and honest about our roles as principals and agents might allow us to be slightly better colleagues, spouses, parents, and children than we might otherwise be.\n\nJune 9, 2017\n\u001c100\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAre we being agents of social expectations or being true to ourselves as principals?\n\nJune 11, 2017\n\u001c101\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“My dear, I am worried about you. It seems to me that you are in a muddle . . . Take an old man’s word; there’s nothing worse than a muddle in all the world. It is easy to face Death and Fate, and the things that sound so dreadful. It is on my muddles that I look back with horror—on the things that I might have avoided . . . Though life is very glorious, it is difficult . . . ‘Life’ wrote a friend of mine, ‘is a public performance on the violin, in which\n\nJune 11, 2017\n\u001c101\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cyou must learn the instrument as you go along.’ I think he puts it well. Man has to pick up the use of his functions as he goes along—especially the function of Love.” Then he burst out excitedly; “That’s it; that’s what I mean. You love George!”\n\nJune 11, 2017\n\u001c101\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cShould is how others want us to show up in the world — how we’re supposed to think, what we ought to say, what we should or shouldn’t do. It’s the vast array of expectations that others layer upon us\n\nHmm expectations.collect do |should| should.is_important ? should : must end Or, should \u003d must\n\nJune 11, 2017\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cwhen we are alone with our truest, most authentic self. It’s our instincts, our cravings and longings, the things and places and ideas we burn for, the intuition that swells up from somewhere deep inside of us. Must is what happens when we stop conforming to other people’s ideals and start connecting to our own.” In other words, “Lucy, go for George”—stop being the agent of social expectations and be your own principal.\n\nJune 11, 2017\n\u001c102\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cin the course of any narrative, the major characters have to metamorphose. They have to go through an experience that forces\n\nJune 11, 2017\n\u001c103\n\u0011\n\u0011"},{"ty":"te","id":"i.56","spi":30810},{"ty":"te","id":"i.57","spi":31228},{"ty":"te","id":"i.58","spi":31621},{"ty":"te","id":"i.59","spi":31807},{"ty":"te","id":"i.60","spi":31839},{"ty":"te","id":"i.61","spi":31996},{"ty":"te","id":"i.62","spi":32589},{"ty":"te","id":"i.63","spi":33053},{"ty":"te","id":"i.64","spi":33173},{"ty":"te","id":"i.65","spi":33667},{"ty":"te","id":"i.66","spi":33949},{"ty":"te","id":"i.67","spi":34280},{"ty":"te","id":"i.68","spi":34739},{"ty":"as","st":"paragraph","si":30801,"ei":30801,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":30802,"ei":30802,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps