":false}},{"ty":"as","st":"text","si":34868,"ei":34882,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunk = [{"ty":"is","ibi":34890,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthem to learn something and change. So Leo was going to change, he was going to bloom. He would start out as a little man who salutes whatever society teaches him to salute . . . but in Leo Bloom’s heart there was a much more complicated and protean creature—the guy he’d never dare to be, because he ain’t gonna take them chances. He was going to play it straight and trudge right through to his grave, until he ran into Max . . . they catalyze each other . . . so much so that this innocent guy comes up with the idea of making a fortune by producing a surefire flop and selling twenty-five thousand per cent of the profits in advance to old ladies.\n\nJune 11, 2017\n\u001c103\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFor me, the lesson of that book is that many of our problems as adults are reflections of unresolved experiences that we had as children. As adults, we turn into unwitting agents of sublimated experiences and much of adulthood is just about figuring out that you are, in fact, an unwitting agent of those experiences. Ultimately\n\nJune 12, 2017\n\u001c106\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cit’s about learning to not be an unwitting agent—and to be conscious of those past experiences and to become a principal, a conscious architect of your own life.\n\nJune 12, 2017\n\u001c106\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cA blank piece of paper is God’s way of telling us how hard it is to be God.” The act of creating ourselves is a miracle—and, fortunately, we have more than seven days to become principals rather than agents.\n\nJune 12, 2017\n\u001c107\n\u0011\n\u0011\n\n\nNo Romance Without Finance\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAsymmetric mergers are easy but of limited value, and mergers of equals are horribly difficult but potentially very rewarding:\n\nJune 12, 2017\n\u001c122\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cUltimately, it’s all about culture, “doing the work,” and execution: For all the finance in mergers, any practitioner will tell you that culture and execution are everything. Dick Parsons said that AOL and Time Warner were “like different spe cies, and in fact, they were species that were inherently at war.” The supposed opportunities for cross-selling and synergies that motivated the merger were also reflective of deep cultural differences. But it wasn’t just cultural differences—no one seemed up to the\n\nJune 12, 2017\n\u001c123\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cgigantic task and hard work of executing on the merger. When AOL and Time Warner split in 2009, Steve Case concluded, in a tweet, no less, “Thomas Edison : ‘Vision without execution is hallucination’—pretty much sums up AOL/TW—failure of leadership (myself included).\n\nJune 12, 2017\n\u001c123\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cJune 12, 2017\n\u001c123\n\u0011\n\u0011\n\n\nLiving the Dream\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBut Bentham’s most blistering and convincing argument cut to the core of why credit markets are important. By limiting access to only the best credits, Smith was privileging the position of “old-fashioned” borrowers with traditional needs and impeding the innovators and upstarts with well-grounded but risky projects. Smith had applied a “stamp of indiscriminate reprobation” upon “all such persons as, in the pursuit of wealth, strike out into any new channel, and particularly, into any new channel of invention” in favor of those “whose trade runs in the old channels, and to the best security which such channels can afford.” Outlawing high interest rates and demeaning borrowing prevented innovation and growth, was inconsistent with liberty, and was unnecessary since lenders could take care of themselves.\n\nJune 13, 2017\n\u001c133\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSo how much leverage should a company take on? The simplest finance answer for firms is that they trade off two contrary impulses—the tax advantages of using debt versus the risk that debt imposes on organizations. Because interest payments are tax deductible for firms and individuals, it can be advantageous to use debt. In short, by taking on debt to finance equipment purchases or a home for an individual, you are allowed by the government to pay less in taxes and to shift value from the government to yourself.\n\nJune 13, 2017\n\u001c137\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMuch of what life has to offer requires the help of others. Being married, starting a family, engaging in meaningful friendships, working in organizations, starting a business are all value-generating activities that one simply can’t do alone. Getting that help creates a set of commitments—and those commitments come with constraints. In short, how you are able to embed yourself in broader networks and relationships through commitments will determine your ultimate trajectory—much as debt shapes the trajectories of firms by providing resources in return for commitments.\n\nJune 13, 2017\n\u001c138\n\u0011\n\u0011"},{"ty