8300,"ei":38314,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":38334,"ei":38852,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#93e3ed","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":38853,"ei":38867,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":38887,"ei":39462,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":39463,"ei":39477,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="eX+YvbmStdAt+iedMOQhcScWNf8"  nonce="eX+YvbmStdAt+iedMOQhcScWNf8">DOCS_modelChunk = [{"ty":"is","ibi":39485,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSuccessful entrepreneurs are Orwells who must become more like a Koons. Ideas may germinate in your head, but creating a business out of them will certainly require innumerable interdependencies\n\nJune 13, 2017\n\u001c142\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat kinds of mistakes do people make in levering their lives? Most obviously, they can take on too many commitments and obligations and may not be able to live up to those obligations. We’ll return to that in the following chapter when we talk about financial distress and bankruptcy. But what mistake do people make on average ? One of the central facts about corporations and their financing decisions maps particularly well to our lives. By most measures, firms are dramatically underlevered. They don’t appear to take the full advantages that the tradeoff theory implies and, as a result, remain underlevered\n\nJune 13, 2017\n\u001c142\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMany individuals may well do the same thing—they retreat from commitments and obligations, and in the process, they limit what they can do. Studies of regret show that regret mostly arises from commitments avoided—untaken educational opportunities, missed love connections, and inattention to children.\n\nJune 13, 2017\n\u001c142\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIs leverage just a benevolent tool to help you achieve your dreams? Is it all just that simple? Anyone who’s labored under the weight of loans can attest to the difficulties leverage can create. The pressure of student loans and mortgages can change the shape of our lives. The commitments of leverage can even preclude you from pursuing the dreams you might have otherwise pursued—mired in student debt, you may ask yourself if you can take on additional commitments to pursue those dreams. That problem is known by the ominous name of “debt overhang.” The idea of debt overhang is that you can prevent yourself from doing things you should do because of the shadow of a preexisting commitment.\n\nJune 13, 2017\n\u001c143\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe logic of the leverage bonus extends further. By embedding yourself in demanding relationships and making commitments, you may well just become a better person. In offering advice to young people, Thomas Watson, the founder of IBM, said, “Don’t make friends who are comfortable to be with. Make friends who will force you to lever yourself up.” Commitments to smart and demanding people keep us from doing stupid things—we gain from those commitments. Leverage is not a zero-sum game.\n\nJune 13, 2017\n\u001c149\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn addition to allowing you to be more productive and raising your own standards, embedding yourself in meaningful relationships is simply good for you.\n\nJune 13, 2017\n\u001c149\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cand physical development by continuing the so-called Grant Study of Harvard undergraduates in the late 1930s. By tracking physiological and emotional data over more than seventy years, Vaillant and his colleagues provide some of the best evidence on what matters for longevity and happiness. And the answer he arrived at, as described by Joshua Wolf Shenk, is deceptively simple. Vaillant’s other main interest is the power of relationships. “It is social aptitude,” he writes, “not intellectual brilliance or parental social class, that leads to successful aging.” Warm connections are necessary—and if not found in a mother or father, they can come from siblings, uncles, friends, mentors. The men’s relationships at age 47, he found, predicted late-life adjustment better than any other variable, except defenses [mechanisms for reacting to adversity]. Good sibling relationships seem especially powerful: 93 percent of the men who were thriving at age 65 had been close to a brother or sister when younger.\n\nJune 13, 2017\n\u001c150\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThat the only thing that really matters in life are your relationships to other people.”\n\nJune 13, 2017\n\u001c150\n\u0011\n\u0011\n\n\nWhy Everyone Hates Finance\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthe “discipline of the market” shrouds all of finance in a meritocratic haze. Investors come to see their outcomes as reflecting their ability, given the chaotic, competitive market they work in, rather than acknowledging the dominant role of chance.\n\nJune 15, 2017\n\u001c180\n\u0011\n\u0011"}}'


